import React, { useState } from 'react';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

const SideMenu = () => {
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);

  const toggleDrawer = (isOpen) => {
    setIsDrawerOpen(isOpen);
  };

  return (
    <div>
      {/* Open side menu button */}
      <IconButton onClick={() => toggleDrawer(true)}>
        <MenuIcon />
      </IconButton>

      {/* Side Menu (Drawer) */}
      <Drawer anchor="left" open={isDrawerOpen} onClose={() => toggleDrawer(false)} ModalProps={{ style: { zIndex: 1000 } }}>
        <List>
          <ListItem button onClick={() => console.log('Menu Item 1 clicked')}>
            <ListItemText primary="Menu Item 1" />
          </ListItem>
          <ListItem button onClick={() => console.log('Menu Item 2 clicked')}>
            <ListItemText primary="Menu Item 2" />
          </ListItem>
          <ListItem button onClick={() => console.log('Menu Item 3 clicked')}>
            <ListItemText primary="Menu Item 3" />
          </ListItem>
        </List>
      </Drawer>
    </div>
  );
};

export default SideMenu;
